import React from "react";

class colaborador extends React.Component {
    constructor(props) {
        
        super(props);
        this.state = {
            nombre: props.nombre,
            apellido: props.apellido,
            correo: props.correo,
            telefono: props.telefono,
            fechaNacimiento: props.fechaNacimiento,
            supervisadoPor: props.supervisadoPor
            
        };
    }

    
}

export default colaborador;
